import React from 'react';
import { BrowserRouter, Routes, Route } from 'react-router-dom';
import MainPage from '../pages/MainPage';

function App() {
  return (
    <>
    <Routes>
      <Route path='/' element={<MainPage />}/>
    </Routes>
    </>
  )
}
export default App;
